const Contact = () => {
  return (
    <>
     <div className='section'>
        <div className="header">
      <h1>Contact me</h1>
    <div className="underline"></div>
    </div>
    <div>Email me at matt.engerer@aol.com OR fill out the form below!</div>
    <ContactForm></ContactForm>
 </div>

    </>
  );
};

export default Contact;
